import math
from x_prop import *

def smfrd2(FreshFuelRadius, CladdingInnerRadius, CladdingOuterRadius, Pitch, AssemblyPitch,Name, InnerAssemblySideLength,
         DuctedAssemblySideLength, CoreActinideMass, Power, ReflectorPinOuterRadius, ReflectorPinInnerRadius, 
         ReflectorPinPitch, ReflectorPinSlugRadius, ReflectorPinsPerAssembly, EquivalentCladdingRadius, SerpentSMFRPlotting,
         SerpentDepletion, LowerEndCapLength, LowerGasPlenumLength, LowerInsulatorPelletLength, FuelLength, UpperInsulatorPelletLength,
         UpperGasPlenumLength, UpperEndCapLength, ShieldPinOuterRadius, ShieldPinInnerRadius, ShieldPinPitch, ShieldPinSlugRadius,
         ShieldPinsPerAssembly, SerpentDPA, Assemblies, SerpentAxialZones, PinsPerAssembly, InternalRadialComponentWidth,
         LowerCoolantPlenaLength, IHXLength, IHXToTop, PrimaryVesselThickness, ThermalCenterElevation, CoreBarrelThickness,
         ControlPinOuterRadius, ControlPinInnerRadius, ControlPinPitch, ControlPinSlugRadius, BUControlPinsPerAssembly,
         ControlInnerSideLength, ControlOuterSideLength, ScramPinOuterRadius, ScramPinInnerRadius, ScramPinPitch, ScramPinSlugRadius,
         ScramInnerSideLength, ScramOuterSideLength, ScramPinsPerAssembly, AxialShieldPinRadius, AxialReflectorPinRadius,
         LowerShieldLength, LowerReflectorLength, UpperShieldLength, UpperReflectorLength, LowerGridPlateHeight, InletPlenumHeight,
         BottomPlateHeight, BottomSupportStructureHeight, SerpentDepletionType, SerpentDepletionSteps, SerpentDepletionPCC,
         SerpentDepletionEnd, SerpentACElibpath, SerpentDEClibpath, SerpentNFYlibpath, SerpentCylNeutrons, SerpentCylActiveCycles,   
         SerpentCylInactiveCycles, SerpentInventory, CoreMap, CoreBarrelRadius, CoreLatticeElements, AssemblyHexagonSideLength,
         WhereSMFRD, FuelTemperaturePerturbation, SerpentAxialFuelTemperature, Fuel, FuelExpansion, FuelAverageTemperature,
         RadialExpansionTemperaturePerturbation, LowerGridPlateSteel, zoneSC, RadialReflectorRows, RadialShieldRows, RadiusChange,
         CoolantInletTemperature, Batches, FreeExpansionDensity, SerpentAxialFuelDensity, SerpentPerturbedAxialFuelDensity,
         AverageFuelDensity, PerturbedAverageFuelDensity, LowerGridDPA, SerpentDepletionAccuracy, WhereInCycle, CladdingDPA,
         SequentialScramRodInsertion, FuelType, InnerFuelRadius, PlotPixels):

  ################################################################################################### //// ######## //// #######
  #####################  Convert units from meters to centimeters                             ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  FreshFuelRadius          = FreshFuelRadius          * 100
  CladdingInnerRadius      = CladdingInnerRadius      * 100
  Pitch                    = Pitch                    * 100
  AxialShieldPinRadius     = AxialShieldPinRadius     * 100
  AxialReflectorPinRadius  = AxialReflectorPinRadius  * 100
  InnerFuelRadius          = InnerFuelRadius          * 100

  ################################################################################################### //// ######## //// #######
  #####################  Figure out how deep to insert BU-control elements                    ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if WhereInCycle == "BOC":

    BUControlElementInsertion = -100

  elif WhereInCycle == "MOC":

    BUControlElementInsertion = int(round((SerpentAxialZones+1)/2,0)-1)

  else:

    BUControlElementInsertion = 100

  ################################################################################################### //// ######## //// #######
  #####################  Write information file about axial expansion reactivity              ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if WhereSMFRD == "FuelReactivity":
  
    A = "results/" + Name + "/0__info__fuelexpansion.txt"
    a = open(A, 'w')
  
    a.write("The model has the fuel expansion reactivity feedback setting activated \n")
  
    if FuelExpansion == "Axial" or FuelExpansion == "axial" or FuelExpansion == "AXIAL":
  
      Dir = "the axial"
  
    elif FuelExpansion == "Radial" or FuelExpansion == "radial" or FuelExpansion == "RADIAL":
  
      Dir = "the radial"
  
    else:
  
      Dir = "all"
  
    A = "Fuel is technically allowed to expand in " + Dir + " direction(s) \n"
    a.write(A)
    a.write("\n")
    A = "The nominal average fuel temperature is: {0:02.1f}".format(FuelAverageTemperature-273) + " deg. C \n"
    a.write(A)
    A = "The nominal average fuel density is: {0:02.2f}".format(AverageFuelDensity) + " g/cm^3 \n"
    a.write(A) 
    a.write("\n")   
    
    if FuelTemperaturePerturbation == "void" or FuelTemperaturePerturbation == "Void":

      A = "The perturbation is modeled as a complete void of the fuel in the given axial region \n"
      a.write(A)

    else:

      A = "The perturbation is modeled as increase in temperature of {0:02.1f}".format(FuelTemperaturePerturbation) + " deg C \n"
      a.write(A)

      a.write("\n")
      A = "The perturbed average fuel temperature is: {0:02.1f}".format(FuelAverageTemperature-273+FuelTemperaturePerturbation) + " deg. C \n"
      a.write(A)
      A = "The perturbed average fuel density is: {0:02.2f}".format(PerturbedAverageFuelDensity) + " g/cm^3 \n"
      a.write(A) 
      a.write("\n")  

      A = "The initial dimensions of the fuel are: \n"
      a.write(A)
      A = "Height: {0:02.1f}".format(FuelLength*100) + " cm \n"
      a.write(A)
      A = "Radius: {0:02.3f}".format(FreshFuelRadius) + " cm \n"
      a.write(A)

      Volume1 = FuelLength* 100 * math.pi * (FreshFuelRadius) ** 2
      Mass    = Volume1 * AverageFuelDensity

      A = "Volume: {0:02.3f}".format(Volume1) + " cm^3 \n"
      a.write(A) 

      a.write("\n")

      A = "The perturbed dimensions of the fuel are: \n"
      a.write(A)

      if Dir == "the radial":

        NewHeight = FuelLength*100

        A = "Height: {0:02.1f}".format(NewHeight) + " cm (no change) \n"
        a.write(A)

        NewRadius = math.sqrt(AverageFuelDensity * PerturbedAverageFuelDensity) * (FreshFuelRadius) / PerturbedAverageFuelDensity

        if NewRadius > CladdingInnerRadius:

          a.write("\n")
          A = "The calculated radius ({0:02.3f}".format(NewRadius) + " cm) from the given temperature perturbation exceeds the cladding inner radius ({0:02.3f}".format(CladdingInnerRadius) + " cm)\n"
          a.write(A)

          NewRadius = CladdingInnerRadius
          A = "The radius for this calculation will therefore be set to the cladding inner radius: {0:02.3f}".format(CladdingInnerRadius) + " cm +{0:02.2%}".format(NewRadius/(FreshFuelRadius) - 1)+ ")\n"
          a.write(A)
          a.write("\n")

        else:

          A = "Radius: {0:02.3f}".format(NewRadius) + " cm (+{0:02.3f}".format(10*(NewRadius-FreshFuelRadius)) + " mm, +{0:02.2%}".format(NewRadius/(FreshFuelRadius) - 1)+ ")\n"
          a.write(A)

        Volume2 = math.pi * (FuelLength*100) * (NewRadius ** 2)

        A = "Volume: {0:02.3f}".format(Volume2) + " cm^3 (+{0:02.3f}".format(Volume2-Volume1) + " cm^3, +{0:02.2%}".format(Volume2/Volume1 - 1)+ ")\n"
        a.write(A) 

      elif Dir == "the axial":

        NewHeight = AverageFuelDensity * (FuelLength*100) / PerturbedAverageFuelDensity

        A = "Height: {0:02.1f}".format(NewHeight) + " (+{0:02.3f}".format((NewHeight-FuelLength*100)) + " cm, +{0:02.2%}".format(NewHeight/(FuelLength*100) - 1)+ ")\n"
        a.write(A)

        NewRadius = FreshFuelRadius

        A = "Radius: {0:02.3f}".format(NewRadius) + " cm (no change)\n"
        a.write(A)

        Volume2 = math.pi * NewHeight * ((NewRadius) ** 2)

        A = "Volume: {0:02.3f}".format(Volume2) + " cm^3 (+{0:02.3f}".format(Volume2-Volume1) + " cm^3, +{0:02.2%}".format(Volume2/Volume1 - 1)+ ")\n"
        a.write(A) 

      else:

        RelExp = (AverageFuelDensity/PerturbedAverageFuelDensity)**(1/3)

        NewHeight = (FuelLength*100) * RelExp

        A = "Height: {0:02.1f}".format(NewHeight) + " (+{0:02.2f}".format((NewHeight-FuelLength*100)) + " cm, +{0:02.2%}".format(NewHeight/(FuelLength*100) - 1)+ ")\n"
        a.write(A)        

        NewRadius = (FreshFuelRadius) * RelExp

        if NewRadius > CladdingInnerRadius:

          a.write("\n")
          A = "The calculated radius ({0:02.3f}".format(NewRadius) + " cm) from the given temperature perturbation exceeds the cladding inner radius ({0:02.3f}".format(CladdingInnerRadius) + " cm)\n"
          a.write(A)
          
          NewRadius = CladdingInnerRadius
          A = "The radius for this calculation will therefore be set to the cladding inner radius: {0:02.3f}".format(CladdingInnerRadius) + " cm (+{0:02.2%}".format(NewRadius/(FreshFuelRadius) - 1)+ ")\n"
          a.write(A)
          a.write("\n")

        else:

          A = "Radius: {0:02.3f}".format(NewRadius) + " cm (+{0:02.3f}".format(10*(NewRadius-FreshFuelRadius)) + " mm, +{0:02.2%}".format(NewRadius/(FreshFuelRadius) - 1)+ ")\n"
          a.write(A)

        Volume2 = math.pi * NewHeight * (NewRadius ** 2)

        A = "Volume: {0:02.3f}".format(Volume2) + " cm^3 (+{0:02.2f}".format(Volume2-Volume1) + " cm^3, +{0:02.2%}".format(Volume2/Volume1 - 1)+ ")\n"
        a.write(A) 

      a.write("\n") 

      NewFuelRadius     = NewRadius
      NewFuelLength     = NewHeight
      FuelRadiusChange  = NewRadius - FreshFuelRadius
      FuelLengthChange  = NewFuelLength - 100 * FuelLength
      NewStepFuelLength = NewFuelLength / SerpentAxialZones

  InnerAssemblyApothem  = (math.sqrt(3)/2) * InnerAssemblySideLength
  DuctedAssemblyApothem = (math.sqrt(3)/2) * DuctedAssemblySideLength
  AssemblyApothem       = (math.sqrt(3)/2) * AssemblyHexagonSideLength
  AssemblyPitchRadius   = (math.sqrt(3)/2) * AssemblyPitch

  if CoreBarrelRadius == "C":

    LXX = []
  
    for x in range(CoreLatticeElements):
  
      LX = 0
  
      for i in range(CoreLatticeElements):
  
        if CoreMap[CoreLatticeElements*x+i] != 0 and CoreMap[CoreLatticeElements*x+i] != 11:
  
          LX += 1
  
      LXX.append(LX)
  
    CoreBarrelRadius = (max(LXX) * AssemblyPitchRadius / 2) + ((AssemblyPitchRadius / 2) * (1/math.sqrt(3))/2)

  FueledRadius = ((max(LXX) - RadialReflectorRows - RadialShieldRows) * AssemblyPitch / 2) + (AssemblyHexagonSideLength * (1/math.sqrt(3))/2)

  CoreBarrelRadius0 = CoreBarrelRadius 

  GridPlateVolume = LowerGridPlateHeight * math.pi * (CoreBarrelRadius0 ** 2) # cm^3
  InletPlenumVolume = InletPlenumHeight * math.pi *  (CoreBarrelRadius0 ** 2) # cm^3

  FuelStep0 = 100 * FuelLength / SerpentAxialZones

  # Check the number of fuel assemblies
  CalcAssemblies = 0

  for element in CoreMap:

    if element < 6 and element != 0:

      CalcAssemblies += 1

  if CalcAssemblies != Assemblies:

    print("WARNING -- Number of fuel assemblies in core-map (" + str(CalcAssemblies) + ") does not match input fuel assemblies (" + str(Assemblies) + ")")

  ################################################################################################### //// ######## //// #######
  ##################### Use either equivalent radius for cladding (which includes wire)       ####### //// ######## //// #######
  ##################### or the actual diameter (for plotting)                                 ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if SerpentSMFRPlotting == "on":

    CladdingOuterRadius = CladdingOuterRadius * 100

  else:

    CladdingOuterRadius = EquivalentCladdingRadius * 100

  ################################################################################################### //// ######## //// #######
  #####################  Power denisty kW/g-actinide                                          ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  # Power in kW
  PowerKW = Power / 1000

  # Actinide mass is in grams
  CoreActinideMassGrams = CoreActinideMass * 1000

  # kW/g-actinide
  ActinidePowerDensity = PowerKW / CoreActinideMassGrams

  ################################################################################################### //// ######## //// #######
  #####################  Defining the axial center level                                       ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  A = SerpentAxialZones/2
  RA = round(A, 0)
  RoundedMidCore = int(RA)

  ################################################################################################### //// ######## //// #######
  #####################  BEGIN WRITING SERPENT INPUT FILE                                     ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if WhereSMFRD == "Reference":

    A = Name + "_geometry_reference"
    smr = open(A, 'w')

  elif WhereSMFRD == "Totalvoid":

    A = Name + "_geometry_totvoid"
    smr = open(A, 'w')

  elif WhereSMFRD == "CoolantReactivity":
  
    A = Name + "_geometry_coolantreactivity"
    smr = open(A, "w") 

  elif WhereSMFRD == "LowerCoolantReactivity":

    A = Name + "_geometry_lowcoolantreactivity"
    smr = open(A, "w") 

  elif WhereSMFRD == "UpperCoolantReactivity":

    A = Name + "_geometry_upcoolantreactivity"
    smr = open(A, "w") 

  elif WhereSMFRD == "FuelReactivity":
  
    A = Name + "_geometry_fuelreactivity"
    smr = open(A, "w") 

  elif WhereSMFRD == "FuelDoppler":
  
    A = Name + "_geometry_fueldoppler"
    smr = open(A, "w") 

  elif WhereSMFRD == "RadialExpansion":
  
    A = Name + "_geometry_radialexpansion"
    smr = open(A, "w") 

  elif WhereSMFRD == "SequentialCoolant":

    A = Name + "_geometry_seqcool_ax" + str(zoneSC+1)
    smr = open(A, "w")

  elif WhereSMFRD == "SequentialFuel":

    A = Name + "_geometry_seqfuel_ax" + str(zoneSC+1)
    smr = open(A, "w")

  elif WhereSMFRD == "SequentialClad":

    A = Name + "_geometry_seqclad_ax" + str(zoneSC+1)
    smr = open(A, "w")

  elif WhereSMFRD == "BUControlInsertion":

    A = Name + "_geometry_BUC_ax" + str(zoneSC+1)
    smr = open(A, "w")

  elif WhereSMFRD == "SequentialScramRodInsertion":

    A = Name + "_geometry_SCRAM_ax" + str(zoneSC+1)
    smr = open(A, "w")

  ################################################################################################### //// ######## //// #######
  #####################  Title (Core name)                                                    ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  A = "% ################################################################################### //// ######## //// ####### \n"
  B = "% ##################### Core version   ############################################## //// ######## //// ####### \n"
  C = "% ################################################################################### //// ######## //// ####### \n" 

  smr.write(A)
  smr.write(B)
  smr.write(C)
  smr.write("\n")

  smr.write("set title \"" + Name + "\" ")
  smr.write("\n \n")

  ################################################################################################### //// ######## //// #######
  #####################  Radial expansion information                                         ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if WhereSMFRD == "RadialExpansion":
  
    CIT_C = CoolantInletTemperature - 273.15

    GridPlateProperties = nonfuelsolidproperties(material=LowerGridPlateSteel, temperature=CoolantInletTemperature, fastflux=1, stress=1, dpa=1, porosity=1)
    AlphaPlate = GridPlateProperties.averagelinearthermalexpansioncoefficient

    NewMaxRadius = CoreBarrelRadius0 * (1 + RadialExpansionTemperaturePerturbation * AlphaPlate)
    ChangeRadius = NewMaxRadius - CoreBarrelRadius0
    
    AssemblyPitchRadius_Perturbed = AssemblyPitchRadius
    NewRadius = 0
    
    while NewRadius < NewMaxRadius:
    
      AssemblyPitchRadius_Perturbed += 1e-5
      NewRadius = (max(LXX) * AssemblyPitchRadius_Perturbed / 2) + ((AssemblyPitchRadius_Perturbed / 2) * (1/math.sqrt(3))/2)
    
    PitchChange = AssemblyPitchRadius_Perturbed - AssemblyPitchRadius
    RadiusChange = ChangeRadius
  
    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ##### This model represents a homeogeneously radially expanded core \n"
    C = "% ##### The modeled perturbation is a temperature increase of {0:02.1f}".format(RadialExpansionTemperaturePerturbation) + " deg . C \n"
    D = "% ##### The maximum core diameter has been increased by {0:02.2f}".format(ChangeRadius*20) + " mm \n"
    E = "% ##### From {0:02.3f}".format(CoreBarrelRadius*2) + " to {0:02.3f}".format(NewRadius*2) + " cm \n"
    F = "% ##### This is modeled an increase in the assembly pitch of {0:02.2f}".format(PitchChange*10) + " mm \n"
    G = "% ##### From {0:02.3f}".format(AssemblyPitchRadius) + " to {0:02.3f}".format(AssemblyPitchRadius_Perturbed) + " cm \n"   
    H = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write(D)
    smr.write(E)
    smr.write(F)
    smr.write(G)
    smr.write(H)   
    smr.write("\n")

    AssemblyPitchRadius = AssemblyPitchRadius_Perturbed
    CoreBarrelRadius = NewRadius

  ################################################################################################### //// ######## //// #######
  #####################  Start Pin ID counter                                                 ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  PinID = 0

  ################################################################################################### //// ######## //// #######
  #####################  Lower end cap (same definition for all rods)                         ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if LowerEndCapLength > 0:

    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ######### Lower end cap (same definition for all rods)                      ####### //// ######## //// ####### \n"
    C = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write("\n")

    PinID += 1   

    smr.write("pin " + str(PinID) + " \n")
    smr.write("lowerendcapmat   {0:02.7f}".format(CladdingInnerRadius) + " % End-cap steel outer radius \n")    
    smr.write("belowcorecladdingmat {0:02.7f}".format(CladdingOuterRadius) + " % Clad outer radius \n")
    smr.write("lowerplenumcoolantmat % Coolant outside of rod \n")
    smr.write("\n")

    LowerEndCapPinID = PinID 

  ################################################################################################### //// ######## //// #######
  #####################  Lower shield inside of the fuel rod (same definition for all rods)   ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if LowerShieldLength > 0:

    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ######### Lower shield inside of the fuel rod                               ####### //// ######## //// ####### \n"
    C = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write("\n")

    PinID += 1   

    smr.write("pin " + str(PinID) + " \n")
    smr.write("loweraxialshieldmat {0:02.7f}".format(AxialShieldPinRadius)  + " % Lower shield pellet outer radius\n")
    smr.write("gas                 {0:02.7f}".format(CladdingInnerRadius)   + " % Cladding inner radius\n")
    smr.write("belowcorecladdingmat    {0:02.7f}".format(CladdingOuterRadius)   + " % Cladding outer radius\n")
    smr.write("lowerplenumcoolantmat % Below-core coolant outside of clad \n")
    smr.write("\n")

    LowerInnerShieldPinID = PinID 

  ################################################################################################### //// ######## //// #######
  #####################  Lower reflector inside of the fuel rod (same definition for all rods)####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if LowerReflectorLength > 0:

    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ######### Lower reflector inside of the fuel rod                            ####### //// ######## //// ####### \n"
    C = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write("\n")

    PinID += 1   

    smr.write("pin " + str(PinID) + " \n")
    smr.write("loweraxialreflectormat {0:02.7f}".format(AxialReflectorPinRadius)  + " % Lower reflector pellet outer radius\n")
    smr.write("gas                    {0:02.7f}".format(CladdingInnerRadius)   + " % Cladding inner radius\n")
    smr.write("belowcorecladdingmat       {0:02.7f}".format(CladdingOuterRadius)   + " % Cladding outer radius\n")
    smr.write("lowerplenumcoolantmat % Below-core coolant outside of clad \n")
    smr.write("\n")

    LowerInnerReflectorPinID = PinID 

  ################################################################################################### //// ######## //// #######
  #####################  Lower gas plenum region (same definition for all rods)               ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if LowerGasPlenumLength > 0:

    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ######### Lower gas plenum (same definition for all rods)                   ####### //// ######## //// ####### \n"
    C = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write("\n")

    PinID += 1

    smr.write("pin " + str(PinID) + " \n")
    smr.write("gas              {0:02.7f}".format(CladdingInnerRadius) + " % Cladding inner radius (gas modeled as Krypton-84) \n")
    smr.write("belowcorecladdingmat {0:02.7f}".format(CladdingOuterRadius) + " % Cladding outer radius\n")
    smr.write("lowerplenumcoolantmat % Below-core coolant outside of clad \n")
    smr.write("\n")

    LowerGasPlenumPinID = PinID    

  ################################################################################################### //// ######## //// #######
  #####################  Lower insulator pellet (same definition for all rods)                ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  if LowerInsulatorPelletLength > 0:

    A = "% ################################################################################### //// ######## //// ####### \n"
    B = "% ######### Lower insulator pellet (same definition for all rods)             ####### //// ######## //// ####### \n"
    C = "% ################################################################################### //// ######## //// ####### \n" 
  
    smr.write(A)
    smr.write(B)
    smr.write(C)
    smr.write("\n")

    PinID += 1
  
    smr.write("pin " + str(PinID) + " \n")
    smr.write("lowerinsulatorpellet {0:02.7f}".format(FreshFuelRadius)     + "  % Lower insulator pellet outer radius\n")
    smr.write("gas                  {0:02.7f}".format(CladdingInnerRadius) + "  % Cladding inner radius\n")
    smr.write("belowcorecladdingmat     {0:02.7f}".format(CladdingOuterRadius) + "  % Cladding outer radius\n")
    smr.write("lowerplenumcoolantmat % Below-core coolant outside of clad \n")
    smr.write("\n")

    LowerInsulatorPinID = PinID

  ################################################################################################### //// ######## //// #######
  #####################  Fuel rod definitions                                                 ####### //// ######## //// #######
  ################################################################################################### //// ######## //// #######

  FuelRodStartID = PinID + 1

  for z in range(SerpentAxialZones):

    T = SerpentAxialFuelTemperature[z]

    for batch in range(Batches):

      A = "% ################################################################################### //// ######## //// ####### \n"
      B = "% ######### Fuel rod in batch #" + str(batch+1) + ", axial level " + str(z+1) + "/" + str(SerpentAxialZones) + " \n"
      C = "% ################################################################################### //// ######## //// ####### \n" 
    
      smr.write(A)
      smr.write(B)
      smr.write(C)
      smr.write("\n")

      PinID += 1

      if WhereSMFRD == "FuelReactivity" and FuelExpansion != "none" and FuelExpansion != "Axial" and FuelExpansion != "axial" and FuelExpansion != "AXIAL":        
  
        A = "% ################################################################################### //// ######## //// ####### \n"
        B = "% ######### Fuel diameter has been increased by {0:02.3f}".format(FuelRadiusChange) + " mm, from {0:02.3f}".format(FreshFuelRadius*10) + " to {0:02.3f}".format(NewFuelRadius*10) + " mm \n"
        C = "% ######### Corresponding to a {0:02.0f}".format(FuelTemperaturePerturbation) + " deg. C perturbation in temperature \n"
        D = "% ################################################################################### //// ######## //// ####### \n" 
    
